import styled from 'styled-components'

export const Container = styled.div`
    width: 100%;
    height: 100%;
`

export const Header = styled.div`
    max-width: 500px;
    height: 150px;
    background-color: #eaeaea;
    color: black;
    font-size: 25px; 
    display: flex;
    justify-content: center;
    align-items: center;
`
